const React = require('react')

class Edit extends React.Component {
    render(){
        const {title, _id, entry, shipIsBroken} = this.props.log
        return (
            <>
                <h1>Edit This Entry</h1>
                <nav>
                    <a href="/logs"> Go Back To Log Home Page</a>
                </nav>
                <form method='POST' action={`/logs/${_id}?_method=PUT`}>
                    Title:<input type='text' name="title" defaultValue={title}></input><br/>
                    Entry:<input type='text' name='entry' defaultValue={entry}></input><br/>
                    ID: <input type='text' defaultValue={_id}></input>
                    Is Ship Broken: <input type='checkbox' name='shipIsBroken' defaultChecked={shipIsBroken}/> <br/> 
                    <input type='submit' value='Edit'></input>
                </form>
            </>
        )
    }
}



module.exports = Edit

